import React from "react";
import AllBags from "./AllBags"; 
import AllKits from "./AllKits";

function AllProducts() {
  return (
    <div>
      <h1>ALL PRODUCTS</h1>
      <AllBags />
      <AllKits />
    </div>
  );
}

export default AllProducts;
